import React from 'react'

const App = () => {
  let crtime = new Date();
  crtime = crtime.getHours()
  let getting = "";
  let cssStyle ={}

  if(crtime >=1 && crtime < 12){
    getting = "Good Morning";  
    cssStyle.coler='yellow'
  }else if(crtime >=12 && crtime < 12){
    cssStyle.coler='green'
  }else{
    getting = "Good Night";  
    cssStyle.coler='black'
  }
  return (
    <>
      <h1>Hello MR. <span style={cssStyle}>{getting}</span> </h1>
    </>
  )
}

export default App
